def solve(a, b):
    # find the larger number
    if a > b:
        larger = a
    else:
        larger = b
    # find the smaller number
    if a < b:
        smaller = a
    else:
        smaller = b
    # initialize lcm
    lcm = larger
    # loop until lcm is found
    while True:
        if lcm % smaller == 0 and lcm % larger == 0:
            break
        lcm += larger
    return lcm
